import React from "react";
import './Projectline.css';
import star from "./ster-paars.svg"
import fileDownload from 'js-file-download'
import axios from "axios";



function Projectline({title,  datum, hour}){

    const handleClick = (url, filename) => {
        axios.get(url, {
            responseType: 'blob',
        })
            .then((res) => {
                fileDownload(res.data, filename)
            })
    }

    function removeData() {
        localStorage.clear();

    }


    return(
<>

                <div className="project-line">
                    <div className="project-title">
                        <img className='star' src={star} alt="sterlogo"/>
                        <h3>{title}</h3>

                        <h4> {datum}</h4>
                        <p> Totaal aan design nodig: {hour} uur</p>
                    </div>

                    <div className="buttons-project">
                        <button
                            onClick={removeData}> Remove
                        </button>
                        <button
                            onClick={handleClick('https://avatars.githubusercontent.com/u/9919?s=280&v=4', 'sample')}> Download
                        </button>
                    </div>

                </div>

</>
    )
}

export default Projectline
